import { Box } from '@mui/system'
import React, { useState } from 'react'

const Stocks = () => {

//Consta for table

const [list_data, setList_data] = useState(false)

  return (
    <div>

      <Grid container style={{border: '2px solid red'}}>

        {/* Search bar */}
        <Grid item md={12} padding={2}>
          
          <Grid
          container
          direction="row"
          justifyContent="center"
          alignItems="center"
          style={{
            backgroundColor:'white',
            border: '2px solid black',
            borderRadius: '5px'
          }}
          padding={2}>

         {/* Search bar */}
            <TextField fullWidth placeholder='Search product data' margin='normal'/>

             {/* Button bar */}
            <Button variant='contained' onClick={e=>
            {
              e.preventDefault();
              list_data ? setList_data(false) : setList_data(true)
            }
            
            
            }> show data list</Button>
          </Grid>

        </Grid>
      

      <Grid item md={12} >
        
        <Grid
        container
        direction="row"
        justifyContent="center"
        alignItems="center"> 
        
        <Collapse in={list_data}>
          
          <Box
          padding={2}
          sx={{ 
            backgroundColor:'white',
            border:'2px solid brown'}}>
          
          
            <TextField fullWidth placeholder='Search product data' margin='normal'/>
            <TextField  fullWidth placeholder='Search product data' margin='normal'/>
            <TextField fullWidth placeholder='Search product data' margin='normal'/>
            <TextField fullWidth placeholder='Search product data' margin='normal'/>
            <TextField fullWidth placeholder='Search product data' margin='normal'/>

          </Box>
        
        </Collapse> 
        
      </Grid>
    
    </Grid>
        
       

    









  </Grid>




    </div>
  )
}

export default Stocks
